  'delta' => '0',
  'body_value' => "<p>Commerce Guys provide many screencasts around the Drupal Commerce ecosystem to demonstrate how you can easily extend your store using contributed modules.</p><p>This tuesday, let's talk about Commerce Customizable Products which is another module that provides custom line item types like Commerce Custom Line Items.</p><p>Watch the <a href='http://drupalcommerce.org/videos/commerce-module-tuesday/commerce-customizable-products'>screencast</a>.</p><p>Find more videos at <a href='http://drupalcommerce.org/videos'>DrupalCommerce.org</a></p>",
